import languages from "../../../library/languages";
import { Typography, Box, ButtonÂ } from "@material-ui/core";

const WebFormVisibleOrNot = ({ webFields, dispatch, addVisibleSelect, showOptionsOnClick, counter, setCounter } : any) => {

  const VisibleOrNot = webFields.map(({fieldName, fieldFormVisible, _id, pause}) =>
    fieldFormVisible === null ? (
      pause ? (
        <Box key={_id} mb="2rem">
          <Typography gutterBottom component="h4" variant="h6">
            {languages.en.shouldBe} <strong>{fieldName}</strong> {languages.en.visibleInForm}?
          </Typography>
          <Button id={fieldName} variant="contained" color="primary" style={{marginRight: "1rem"}} onClick={() => addVisibleSelect(dispatch, setCounter, counter, event)}>
            {languages.en.yes}
          </Button>
          <Button variant="contained" color="secondary" onClick={() => showOptionsOnClick(dispatch)}>{languages.en.no}</Button>
        </Box>
      ) : null
    ) : null
  );

  return (
    <>
    {VisibleOrNot}
    </>
  );
};

export default WebFormVisibleOrNot;
